import clsx from "clsx";
import {
  BarChart,
  Package,
  ShoppingCart,
  Settings,
  EyeOff,
  User,
  UserPlus,
  Users,
  PackageSearch,
  Target,
  PieChart,
  LineChart,
} from "lucide-react";

const SidebarAdmin = ({ isSidebarOpen }) => {
  // Data untuk Sidebar
  const Fiturs = [
    {
      href: "/DashboardAdmin",
      icon: BarChart,
      text: "Dashboard",
    },
    {
      href: "users",
      icon: Users,
      text: "Users",
    },
    {
      href: "#",
      icon: Package,
      text: "Stok",
    },
    {
      href: "order",
      icon: ShoppingCart,
      text: "Order",
    },
    {
      href: "",
      icon: PackageSearch,
      text: "Opname",
    },
  ];

  const employeesData = [
    {
      title: "Total Employees",
      icon: User,
      count: 200,
      bgColor: "bg-gray-100",
    },
    {
      title: "On Leave",
      icon: EyeOff,
      count: 15,
      bgColor: "bg-blue-100",
    },
    {
      title: "New Joinee",
      icon: UserPlus,
      count: 25,
      bgColor: "bg-yellow-100",
    },
  ];

  const shortcutLink = [
    {
      title: "Goals",
      icon: Target,
    },
    {
      title: "Plan",
      icon: PieChart,
    },
    {
      title: "Stats",
      icon: LineChart,
    },
    {
      title: "Setting",
      icon: Settings,
    },
  ];

  return (
    <aside
      className={clsx(
        "fixed top-0 left-0 z-40 w-64 h-screen bg-white border-r border-gray-200",
        "dark:bg-gray-800 dark:border-gray-700 transition-transform",
        {
          "translate-x-0": isSidebarOpen,
          "-translate-x-full": !isSidebarOpen,
        }
      )}
    >
      {/* Header */}
      <div className="flex items-center justify-center py-4 border-b border-gray-200 dark:border-gray-700">
        <h1 className="text-xl font-semibold text-gray-900 dark:text-white">
          Salesai
        </h1>
      </div>

      {/* Menu */}
      <div className="flex-1 px-4 py-4 overflow-y-auto">
        <ul className="space-y-2">
          {Fiturs.map((item, index) => (
            <li key={index}>
              <a
                href={item.href}
                className="flex items-center px-4 py-2 text-gray-600 hover:bg-gray-100 dark:text-gray-400 dark:hover:bg-gray-700 rounded-lg"
              >
                <item.icon className="w-5 h-5" />
                <span className="ml-3">{item.text}</span>
              </a>
            </li>
          ))}
        </ul>
      </div>

      {/* Shortcuts */}
      <div className="py-4 border-t border-gray-200 dark:border-gray-700">
        <h2 className="px-4 text-sm font-semibold text-gray-600 dark:text-gray-400">
          Shortcuts
        </h2>
        <ul className="mt-2 space-y-2">
          {shortcutLink.map((shortcut, index) => (
            <li key={index}>
              <button className="flex items-center px-4 py-2 text-gray-600 hover:bg-gray-100 dark:text-gray-400 dark:hover:bg-gray-700 rounded-lg">
                <shortcut.icon className="w-5 h-5" />
                <span className="ml-3">{shortcut.title}</span>
              </button>
            </li>
          ))}
        </ul>
      </div>

      {/* Employees Section */}
      <div className="py-4 border-t border-gray-200 dark:border-gray-700">
        <h2 className="px-4 text-sm font-semibold text-gray-600 dark:text-gray-400">
          Employees
        </h2>
        <ul className="mt-2 space-y-2">
          {employeesData.map((employee, index) => (
            <li
              key={index}
              className={`flex items-center px-4 py-2 rounded-lg ${employee.bgColor}`}
            >
              <employee.icon className="w-5 h-5 text-gray-600 dark:text-gray-300" />
              <div className="ml-3">
                <h3 className="text-sm font-medium text-gray-700 dark:text-gray-200">
                  {employee.title}
                </h3>
                <span className="text-xs text-gray-500 dark:text-gray-400">
                  {employee.count}
                </span>
              </div>
            </li>
          ))}
        </ul>
      </div>
    </aside>
  );
};

export default SidebarAdmin;
